import scss from './section-solution.module.scss'
import img from "../../images/home/people.jpg";
import imgwebp from "../../images/home/people.webp";
import imgwebp2x from "../../images/home/people@2x.webp";


export const SectionSolution = () => {
    return (
      <div>
        <div className={scss.imgWrapper}>
          <picture>
            <source srcset={`${imgwebp} 1x, `} type="image/webp" />
            <source srcset={imgwebp2x} type="image/webp" />
            <img src={img} alt="team" />
          </picture>
        </div>
        <div className={scss.solutions}></div>
      </div>
    );
}
